import React from "react";
import "../css/Mobile.css";
import { GridWrap, GridRow, GridColumn } from "emotion-flex-grid";
import { jsx, ThemeProvider } from "@emotion/react";

export default function Nav() {
  const theme = {
    spacing: {
      xl: 40,
    },
  };

  return (
    <ThemeProvider theme={theme}>
      <GridRow
        css={(theme) => ({ spacing: theme.spacing.xl })}
        justify="between"
        align="center"
        p={"m"}
      >
        <div className="logo-container">
          <div>
            <img src="./images/star.svg" alt="Main Logo1" />
            <img src="./images/star.svg" alt="Main Logo2" />
          </div>
          <h1 className="logo-text">Cardo</h1>
        </div>
        <div className="hamburger-menu">
          <div></div>
          <div></div>
          <div></div>
        </div>
      </GridRow>
    </ThemeProvider>
  );
}
